焼結ダイヤチップが塗膜をグングンはがします。　<br>専用機不要の塗膜はがし専用ホイール<br><br>  お手持ちの100mmディスクグラインダーで弾性塗膜・接着剤のはく離が素早く、簡単キレイにできます<br><br>【用途】<br>プールの改修・シートはくり後の接着剤屋上防水ウレタン・住宅外壁・ベランダ浴室・橋脚コンクリートの劣化塗膜など<br>サイズ：外径92mm　取付M10ネジ <br><br><!--ここから楽太郎-->
